SnowShopMap::SnowShopMap()
{
	Init();
	DrawOwnScn();
}

SnowShopMap::~SnowShopMap()
{
}

void SnowShopMap::Update(Vector2 offset)
{

	mOffset = { offset.x_,offset.y_ };

}

void SnowShopMap::DrawOwnScn()
{

	for (int y = 0; y < MAP_Y; y++)
	{
		for (int x = 0; x < MAP_X; x++)
		{


			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[a[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[b[y][x]], true);
			//DrawFormatString(32 * x - mOffset.x_, 32 * y - mOffset.y_, GetColor(255, 255, 255), "%d", a[y][x]);
			//DrawFormatString(32 * x - mOffset.x_, 32 * y - mOffset.y_, GetColor(255, 255, 255), "%d", b[y][x]);

		}
	}

}

bool SnowShopMap::Init(void)
{
	if (LoadDivGraph("./image/}bv`bv.png", 1920, 40, 48, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}

	return true;
}

bool SnowShopMap::CheckMapChip(Vector2 pos)
{
	layer1 = a[pos.y_ / 32][pos.x_ / 32];
	layer2 = b[pos.y_ / 32][pos.x_ / 32];

	bool flg = true;	//true=player

	switch (layer1)
	{
	case 1737:
	case 1537:
	{
		flg = false;
		break;
	}

		break;
	default:
		break;
	}

	switch (layer2)
	{
	case 1203:
	case 1285:

	{
		flg = false;
		break;
	}
	break;
	default:
		break;
	}
	

	return flg;
}

int SnowShopMap::GetMapChip(Vector2 pos)
{
	return a[pos.y_ / 32][pos.x_ / 32];
}

int SnowShopMap::GetTMapChip(Vector2 pos)
{
	return b[pos.y_ / 32][pos.x_ / 32];
}
